window.bookSummaryJSON = "<p>A bonding adventure goes horribly wrong in this gripping story of trust, survival, and motherly instincts. Karla and her stepdaughter Olivia are alone on a remote family camping trip when news of a mysterious outbreak in nearby San Francisco begins to trickle in.<br> <br> With little information to go on, the two women must identify the biggest threat to their safety: the supposedly deadly virus, the stranger who stumbles into their campsite, or each other. <br> <br> Playwright Marisela Trevi√±o Orta was awarded a commission through the Audible Emerging Playwrights Fund, an initiative dedicated to developing innovative original plays driven by language and voice. As an Audible-commissioned playwright, she received funding and creative support to develop Nightfall, which was directed by Elena Araoz. <br> <br> <b>Portions of this audiobook contain mature language and themes. Listener discretion is advised.&nbsp;</b></p>"; 
